    @DisplayName("压缩解压")
    @ParameterizedTest
    @MethodSource("getStringStream")
    public void compress(String str) {
        final String compress = CompressUtil.compress(str);
        final String unCompress = CompressUtil.unCompress(compress);
        LOG.info("原始：{}", str.length());
        LOG.info("压缩后：{}", compress.length());
        LOG.info("还原后：{}", unCompress.length());
        LOG.info("解压后与原始对比：{}", unCompress.equals(str));
        LOG.info("压缩比：{}%", (float) compress.length() / unCompress.length() * 100);
        LOG.info("压缩比：{}%", compress.length() / (float) unCompress.length() * 100);
    }

